import Offcanvas from 'react-bootstrap/Offcanvas';

const Aside = ({show,handleShow,handleClose}) => {
  return (
    <aside>
      <Offcanvas show={show} onHide={handleClose} placement='end'>
        <Offcanvas.Header closeButton>
        </Offcanvas.Header>
        <Offcanvas.Body>
          <div className='fs-4 fw-bold'>Qui sommes nous  ?</div>
        </Offcanvas.Body>
      </Offcanvas>
    </aside>
  )
}

export default Aside
